INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (2, 3001100, 130011, 1, 3001, "ヤマト", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2.1, "2030/01/01 14:59:59", 100, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (2, 3001101, 130011, 4, 3001, "ヤマト", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 5.68, "2030/01/01 14:59:59", 101, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3001102, 130011, 1, 3001, "ヤマト", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 0.0, "2030/01/01 14:59:59", 102, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3002100, 130211, 1, 3002, "フブキ", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, "2030/01/01 14:59:59", 100, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3002101, 130211, 1, 3002, "フブキ", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 0.0, "2030/01/01 14:59:59", 101, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (2, 3002102, 130211, 5, 3002, "フブキ", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 8.53, "2030/01/01 14:59:59", 102, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3002103, 130211, 7, 3002, "フブキ", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 5.67, "2030/01/01 14:59:59", 103, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3002104, 130211, 1, 3002, "フブキ", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 0.0, "2030/01/01 14:59:59", 104, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3, 3002300, 130211, 3, 3004, "フブキ", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 0.0, "2030/01/01 14:59:59", 300, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (7, 3002400, 130211, 7, 3005, "フブキ", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, "2030/01/01 14:59:59", 301, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3003200, 130211, 2, 3003, "フブキ", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 4.4, "2030/01/01 14:59:59", 200, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (7, 3003201, 130211, 7, 3003, "フブキ", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 0.0, "2030/01/01 14:59:59", 201, "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (2, 3003202, 130211, 1, 3003, "フブキ", "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 5.6, "2030/01/01 14:59:59", 202, "2024/10/31 12:00:00", -416.5, 0.0);
